import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/signup">About</Link>
        <Link to="/dashboard">Contacts</Link>
      </div>
    </nav>
  );
}

export default Navbar;
